import { React, useState } from "react";
import { Outlet, Link } from "react-router-dom";
import P1 from "../../img/bazaar.png";
import P2 from "../../img/direct-download-badge.png";
import P3 from "../../img/myketmarket.png";
import P4 from "../../img/snapp-pwa.png";
import P5 from "../../img/app_store.svg";

function Downloads() {
  return (
    <section className="w-full mt-6">
      <div className="w-full px-[6%] py-2">
        <LogoLinks />
      </div>
    </section>
  );
}

function LogoLinks() {
  const [pic, setpic] = useState([
    {
      Img: P1,
    },
    {
      Img: P2,
    },
    {
      Img: P3,
    },
    {
      Img: P4,
    },
    {
      Img: P5,
    },
  ]);
  return (
    <nav className="w-full">
      <ul className="w-full flex items-center border border-red-600">
        {pic.map((val, index) => {
          return (
            <li className="grow flex justify-center items-center">
              <Link>
                <img
                  src={val.Img}
                  className="w-[160px] h-[47px]"
                  loading="eager"
                  alt=""
                />
              </Link>
            </li>
          );
        })}
      </ul>
      <Outlet />
    </nav>
  );
}
export default Downloads;
